import Menu from '../components/Menu';

import 'bootstrap/dist/css/bootstrap.min.css';

function Castracao() {
    return (
        <div>
            <Menu />
             <div>
                 <input type="date"/> <input type="time"  min="09:00" max="11:30" min="13:30" max="17:00"/>
             </div>
        </div>
    );
}

export default Castracao;
